            $usage->setName($name[2]);
            $usage->setMinCropStage(floatval($name[3]));
            $usage->setMaxCropStage($name[4]);
            $usage->setStatus($name[5]);
            $usage->setDose(floatval($name[6]));
            $usage->setDoseUnit($name[7]);
            $usage->setDoseUnit2($name[8]);
            $usage->setDAR($name[9]);
            $usage->setMaxActions($name[10]);
            $usage->setConditions($name[11]);
            $usage->setZNTwater($name[12]);
            $usage->setZNTarthropodes($name[13]);
            $usage->setZNTplants($name[14]);

            $manager->persist($usage);

            if (($i % $batchSize) == 0) {
                $manager->flush();
                $manager->clear();
            }

            $i++;
        }
        $manager->flush();

    }

    public function getOrder()
    {
        // the order in which fixtures will be loaded
        // the lower the number, the sooner that this fixture is loaded
        return 6;
    }
